import React from "react";
import { Navigate } from "react-router-dom";




const ProtectedRoute = ({ role, children }) => {
    if (localStorage.getItem("jwtToken") == null) {  
        return <Navigate to='/login'></Navigate>
    }

    return children;
};

export default ProtectedRoute
